    return (
        <>
            <h1>문제 2번</h1>
            <StateEx></StateEx>
            <hr></hr>
            <UseRefEx></UseRefEx>
            <hr></hr>
            <UseEffectEx></UseEffectEx>
        </>
    );
};

export default Problem2;
